import { getWaterBrands } from "../api/api";

function MainPage() {
  const data = getWaterBrands();

  const [waterBrands, setWaterBrands] = useState([]);

  useEffect(() => {
    setWaterBrands()
  });

  return (
    <div>
      <Intro />
      <Row waterBrands={waterBrands} />
      <TableWrapper />
    </div>
  );
}

export default MainPage;
